    </>
  );
};

export const CarouselContainer = styled.div`
  width: 100%;
`;

export const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  margin: 0px, 10px;
`;

export const Body = styled.div`
  height: 40vw;
  width: 60vw;
`;
